import React from 'react';

const person = (props) => {
  return (
    <div>
      <p>
        I will learn React anyhow! {<br />}
        I am {props.names.map(n => {
          return (
            <h3>{n.name}</h3>
          )
        })}
      </p>
      <p>{props.children}</p>
    </div>
  );
};

export default person;
